  false,\n\t\"url\": null,\n\t\"notes\": \"This Inventory and Monitoring Plan (IMP)
  documents natural resource surveys that will be conducted for Kulm Wetland Management
  District from 2015 through 2030, or until the Comprehensive Conservation Plans (CCP;
  2008), Habitat Management Plan (HMP; 2015) or this IMP are revised. The majority
  of surveys considered in this plan address resource management objectives identified
  in the HMP. Other surveys are a continuation of past monitoring conducted for tracking
  long-term trends in specific resources, understanding ecological interactions, or
  are part of regional and national survey efforts. This IMP was developed as per
  the Inventory and Monitoring (I&M) policy (701 FW 2) for the National Wildlife Refuge
  System. An IMP was not developed for Bonehill, Dakota Lake, and Maple River Easement
  Refuges that occur within the District because no biological surveys will be conducted
  through 2030.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
